function noti(t,e){noty({text:e,type:t,animation:{open:"animated fadeInRight",close:"animated fadeOutRight",easing:"easeInOutExpo",speed:0},dismissQueue:!0,force:!1,layout:"bottomRight",timeout:3e3})}function noticlick(t,e){noty({text:e,type:t,animation:{open:"animated fadeInRight",close:"animated fadeOutRight",easing:"easeInOutExpo",speed:0},dismissQueue:!0,force:!0,killer:!0,layout:"topRight",timeout:3e3})}function noticonfirm(t,e){noty({text:e,type:t,animation:{open:"animated fadeInRight",close:"animated fadeOutRight",easing:"easeInOutExpo",speed:0},buttons:[{addClass:"btn btn-primary",text:"OK",onClick:function(t){t.close(),noticlick("success",'You clicked "OK" button')}},{addClass:"btn btn-danger",text:"Cancel",onClick:function(t){t.close(),noticlick("error",'You clicked "Cancel" button')}}],dismissQueue:!1,force:!0,layout:"topRight",timeout:!1})}